import ChangeHistoryIcon from "@mui/icons-material/ChangeHistory";
import HorizontalRuleTwoToneIcon from "@mui/icons-material/HorizontalRuleTwoTone";
import IdolProfile from "./IdolProfile";
import rankingBlue from "../assets/rankingBlue.png";
import rankingRed from "../assets/rankingRed.png";
import styled from "styled-components";

const RankDiv = styled.div`
  display: flex;
  flex-direction: column;
  align-items: center;
  padding-bottom: 15px;
  border-radius: 20px;
`;

const RankInfo = styled.div`
  display: flex;
  flex-direction: row;
  flex: 0.8;
`;

interface ColorDivType {
  color: string;
}

const ColorDiv = styled.div<ColorDivType>`
  color: ${props => (props.color === "red" ? "#FF0000" : "#2400FF")};
`;

const RankList = styled.div`
  display: flex;
  flex-direction: row;
  align-items: center;
  margin-bottom: 20px;
  border-radius: 20px;
  width: 100%;
  justify-content: space-between;
`;

interface RankingNumType {
  rank: string;
}

const RankingNum = styled.div<RankingNumType>`
  font-size: 20px;
  color: ${props =>
    props.rank === "1"
      ? "#FFB800"
      : props.rank === "2"
      ? "#B7B7B7"
      : props.rank === "3"
      ? "#A55A23"
      : "#000000"};
  margin-right: 20px;
`;

const RankingChange = (props: any) => {
  let content;
  if (props.change === "0") {
    content = <HorizontalRuleTwoToneIcon />;
  } else if (props.change[0] === "+") {
    content = (
      <ColorDiv color="red">
        <img src={rankingRed} alt="" />
        {props.change.substr(1)}
      </ColorDiv>
    );
  } else {
    content = (
      <ColorDiv color="blue">
        <img src={rankingBlue} alt="" />
        {props.change.substr(1)}
      </ColorDiv>
    );
  }

  return content;
};

const RankingName = styled.div`
  font-size: 18px;
  margin-left: 40px;
`;

const RankingScore = styled.div`
  font-size: 14px;
  color: #4a4a4a;
`;

function RankingPageBar() {
  const items = [
    {
      rank: "1",
      change: "0",
      name: "세븐틴",
      score: "16931",
      src: "data:image/png;base64,",
    },
    {
      rank: "2",
      change: "+1",
      name: "IVE",
      score: "15222",
      src: "data:image/png;base64,",
    },
    {
      rank: "3",
      change: "+4",
      name: "BTS",
      score: "14114",
      src: "data:image/png;base64,",
    },
    {
      rank: "4",
      change: "-2",
      name: "NCT",
      score: "12712",
      src: "data:image/png;base64,",
    },
    {
      rank: "5",
      change: "-1",
      name: "NCT 127",
      score: "10008",
      src: "data:image/png;base64,",
    },
  ];
  return (
    <RankDiv>
      {items.map((item, idx) => {
        return (
          <RankList>
            <IdolProfile height="100px" width="100px" shape="rect" url={item.src} />
            <RankInfo>
              <RankingNum rank={item.rank}>{item.rank}</RankingNum>
              <RankingChange change={item.change}></RankingChange>
              <RankingName>{item.name}</RankingName>
            </RankInfo>
            <div>
              <RankingScore>{item.score}</RankingScore>
            </div>
          </RankList>
        );
      })}
    </RankDiv>
  );
}

export default RankingPageBar;
